Donation.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract Donation {
    address public owner;
    string public name;
    string public description;
    uint256 public goal;
    uint256 public totalRaised;

    mapping(address => uint256) public donations;

    event Donated(address indexed donor, uint256 amount);

    constructor(string memory _name, string memory _desc, uint256 _goal) {
        owner = msg.sender;
        name = _name;
        description = _desc;
        goal = _goal;
    }

    function donate() external payable {
        require(msg.value > 0, "Send cUSD");
        donations[msg.sender] += msg.value;
        totalRaised += msg.value;
        emit Donated(msg.sender, msg.value);
    }

    function getInfo() external view returns (
        string memory, string memory, uint256, uint256, address
    ) {
        return (name, description, goal, totalRaised, owner);
    }
}

